.block--reveal-widget__advice-of-day .mainBannerAppear {
    animation: mainBannerAppear 1200ms ease-out;
    animation-fill-mode: forwards
}

.block--reveal-widget__advice-of-day .mainBannerDisappear {
    animation: mainBannerDisappear 600ms ease-out
}

.block--reveal-widget__advice-of-day .smallBannerDisappear {
    animation: smallBannerDisappear 1200ms ease-out;
    animation-fill-mode: forwards
}

.block--reveal-widget__advice-of-day .smallBannerAppear {
    animation: smallBannerAppear 600ms ease-out
}

.block--reveal-widget__advice-of-day .footerAppear {
    animation: footerAppear 600ms ease-out;
    animation-delay: 1200ms;
    animation-fill-mode: forwards
}

.block--reveal-widget__advice-of-day .footerDisappear {
    animation: footerDisappear 600ms ease-out
}

@keyframes mainBannerAppear {
    100% {
        top: 20px
    }
}

@keyframes mainBannerDisappear {
    0% {
        top: 20px
    }

    100% {
        top: -150px
    }
}

@keyframes smallBannerDisappear {
    0% {
        opacity: 1
    }

    100% {
        opacity: 0
    }
}

@keyframes smallBannerAppear {
    0% {
        opacity: 0
    }

    100% {
        opacity: 1
    }
}

@keyframes footerAppear {
    0% {
        top: 272px
    }

    100% {
        top: 224px;
        visibility: visible
    }
}

@keyframes footerDisappear {
    0% {
        top: 224px
    }

    100% {
        top: 272px
    }
}

@keyframes note-1 {
    10% {
        opacity: 1
    }

    100% {
        right: 24px;
        top: 42px;
        opacity: 0
    }
}

@keyframes note-2 {
    0% {
        opacity: 0
    }

    10% {
        opacity: 1
    }

    100% {
        top: 22px;
        right: 59px;
        opacity: 0
    }
}

