    height: 100%;
    padding-top: 8px;
    width: 48px;
    max-width: 48px;
    margin-right: 16px
}

#section-navbar-container.icons #section-navbar-block ul li a .border {
    display: none
}

#section-navbar-container.icons #section-navbar-block ul li .section-navbar-item-icon {
    margin-bottom: 4px;
