.block--games-carousel {
    padding: 0;
    margin-bottom: 16px
}

.block--games-carousel .block__header {
    padding-left: 16px;
    padding-right: 16px
}

.block--games-carousel .block__main {
    display: flex;
    overflow-x: auto;
    scroll-behavior: smooth
}

.block--games-carousel .block__main::after {
    content: '';
    min-width: 16px
}

.block--games-carousel .block-item {
    position: relative;
    border-radius: 8px;
    margin-bottom: 16px;
    border: 1px solid #ededed;
    border-radius: 8px;
    width: 67.5%;
    height: 272px;
    overflow: hidden;
    margin-left: 16px;
    flex-shrink: 0;
    scroll-snap-align: center
}

:root[data-color-scheme='dark'] .block--games-carousel .block-item {
    border: none;
    background-color: #353535
}

.block--games-carousel .block-item__body {
    display: flex;
    flex-direction: column;
    height: 226px
}

.block--games-carousel .block-item__body-header {
    display: none
}

.block--games-carousel .block-item__body-logo {
    z-index: 9996
}

.block--games-carousel .block-item__body-logo img {
    max-width: 120px;
    max-height: 16px;
    object-fit: contain
}

.block--games-carousel .block-item__body-logo-light,
.block--games-carousel .block-item__body-logo-dark {
    justify-content: center;
    align-items: center;
    height: 16px;
    padding-left: 16px
}

.block--games-carousel .block-item__body-logo-light {
    display: flex
}

:root[data-color-scheme='dark'] .block--games-carousel .block-item__body-logo-light {
    display: none
}

.block--games-carousel .block-item__body-logo-dark {
    display: none
}

:root[data-color-scheme='dark'] .block--games-carousel .block-item__body-logo-dark {
    display: flex
}

.block--games-carousel .block-item__footer {
    flex-direction: row
}

.block--games-carousel .block-item__publisher-name {
    overflow: hidden;
    display: -webkit-box;
    -webkit-box-orient: vertical;
    -webkit-line-clamp: 1;
    color: #000
}

.block--games-carousel .block-item__title {
    margin-top: -8px;
    padding: 0 16px;
    max-height: 20px;
    z-index: 2;
    overflow: hidden
}

.block--games-carousel .block-item__description {
    padding: 0 16px;
    max-height: 50px;
    color: #666;
