.block--quiz-carousel .block-item__media,
.block--quiz-hero .block-item__media,
.block--quiz-tile .block-item__media {
    position: relative
}

.block--quiz-carousel .block-item__media img,
.block--quiz-hero .block-item__media img,
.block--quiz-tile .block-item__media img {
    height: 100%;
    border-radius: 12px 12px 48px 12px
}

.block--quiz-carousel {
    padding: 0;
    margin-bottom: 16px
}

.block--quiz-carousel .block__header {
    padding-left: 16px;
    padding-right: 16px
}

.block--quiz-carousel .block__main {
    display: flex;
    overflow-x: auto;
    scroll-behavior: smooth
}

.block--quiz-carousel .block__main::after {
    content: '';
    min-width: 16px
}

.block--quiz-carousel .block-item {
    position: relative;
    margin-bottom: 16px;
    border: 1px solid #ededed;
    border-radius: 8px;
    width: 56%;
    height: 272px;
    overflow: hidden;
    margin-left: 16px;
    text-align: center;
    flex-shrink: 0;
    scroll-snap-align: center
}

:root[data-color-scheme='dark'] .block--quiz-carousel .block-item {
    border: none;
    background-color: #353535
}

.block--quiz-carousel .block-item__body {
    display: flex;
    flex-direction: column;
    height: 226px
}

.block--quiz-carousel .block-item__body-header {
    display: none
}

.block--quiz-carousel .block-item__body-logo {
    margin-top: auto;
    padding-bottom: 4px;
    z-index: 9996
}

.block--quiz-carousel .block-item__body-logo img {
    max-width: 120px;
    max-height: 16px;
    object-fit: contain
}

.block--quiz-carousel .block-item__body-logo-light,
.block--quiz-carousel .block-item__body-logo-dark {
    justify-content: center;
    align-items: center;
    height: 16px
}

.block--quiz-carousel .block-item__body-logo-light {
    display: flex
}

:root[data-color-scheme='dark'] .block--quiz-carousel .block-item__body-logo-light {
    display: none
}

.block--quiz-carousel .block-item__body-logo-dark {
    display: none
}

:root[data-color-scheme='dark'] .block--quiz-carousel .block-item__body-logo-dark {
    display: flex
}

.block--quiz-carousel .block-item__media {
    position: relative;
    height: 5rem;
    min-height: 80px;
    margin-bottom: 12px
}

.block--quiz-carousel .block-item__icon-background {
    position: absolute;
    right: 16px;
    top: 50px
}

.block--quiz-carousel .block-item__icon-background svg {
    height: 48px;
    width: 49px;
    fill: #fff
}

:root[data-color-scheme='dark'] .block--quiz-carousel .block-item__icon-background svg {
    fill: #353535
}

