.block--emoji-feedback.fadeOut {
    animation-duration: 400ms;
    animation-delay: 0;
    animation-fill-mode: both;
    animation-name: fadeOut
}

.block--emoji-feedback__header {
    display: flex;
    align-items: center;
    padding: 16px
}

.block--emoji-feedback__body {
    display: flex;
    align-items: center;
    padding: 0 0 16px 0;
    justify-content: center;
    width: 80%;
    margin: auto
}

.block--emoji-feedback__icon {
    margin-right: 0.5rem
}

.block--emoji-feedback__icon img {
    height: 24px;
    width: 24px;
    object-fit: unset
}

.block--emoji-feedback__emoji {
    flex-basis: 25%;
    text-align: center;
    background: none
}

.block--emoji-feedback__emoji svg {
    height: 2rem;
    width: 2rem
}

.block--emoji-feedback__emoji svg.active {
    display: none
}

.block--emoji-feedback__title {
    flex-basis: 80%;
    font-variation-settings: 'wght' 400
}

.block--emoji-feedback__title.fadeIn {
    animation-duration: 400ms;
    animation-delay: 0;
    animation-fill-mode: both;
    animation-name: fadeIn
}

:root[data-mp-app-theme='moment'] .block--emoji-feedback__title {
    font-family: "IBM Plex Sans", sans-serif;
