    animation-delay: 0;
    animation-fill-mode: both;
    animation-name: slideFromTop;
    position: fixed;
    top: 0;
    max-width: 28.125rem;
    width: 100%;
    padding: 1rem;
    background: linear-gradient(0deg, rgba(255, 255, 255, 0.8) 0%, #fff 81.95%);
    box-shadow: 0px 1px 4px rgba(0, 0, 0, 0.5);
    border-radius: 0px 0px 12px 12px;
    z-index: 9999
}

:root[data-color-scheme='dark'] .block--feedback {
    background: linear-gradient(0deg, rgba(53, 53, 53, 0.72) 0%, #353535 81.95%)
}

.feedback-form {
    position: relative;
    min-height: 120px;
    background: gray;
    color: black;
    display: flex;
    flex-direction: column
}

.feedback-form__header {
    display: flex;
    align-items: center
}

.feedback-form__icon {
    margin-right: 0.5rem
}

.feedback-form__icon img {
    height: 24px;
    width: 24px;
    object-fit: unset
}

.feedback-form__title {
    flex-basis: 90%
}

:root[data-mp-app-theme='moment'] .feedback-form__title {
    font-family: "IBM Plex Sans", sans-serif;
    font-size: 1rem;
    font-weight: 600;
    line-height: 1.5rem;
    font-variation-settings: "wdth" 100
}

:root[data-mp-app-theme='vision-you'] .feedback-form__title {
    font-family: "Noto Sans Display";
    font-size: .875rem;
    font-weight: 600;
    line-height: 1.25rem;
    font-variation-settings: "wdth" 70
}

:root[data-mp-app-theme='apricot'] .feedback-form__title {
    font-family: "Montserrat", sans-serif;
    font-size: .875rem;
    font-weight: 500;
    line-height: 1.25rem;
    font-variation-settings: "wdth" 100
}

.feedback-form__close {
    flex-basis: 5%;
    text-align: right
}

.feedback-form__close button {
    margin-top: -12px;
    padding: 16px;
    height: 44px;
    width: 44px;
    background: none;
    color: #353535
}

:root[data-color-scheme='dark'] .feedback-form__close button {
    color: #fff
}

.feedback-form__text {
    font-variation-settings: 'wght' 300;
    text-align: center
}

:root[data-mp-app-theme='moment'] .feedback-form__text {
    font-family: "IBM Plex Sans", sans-serif;
    font-size: .9375rem;
    font-weight: 500;
    line-height: 1.125rem;
    font-variation-settings: "wdth" 100
}

:root[data-mp-app-theme='vision-you'] .feedback-form__text {
    font-family: "Noto Sans Display";
    font-size: .75rem;
