.block--reveal-widget {
    position: relative;
    padding: 16px
}

.block--reveal-widget .block-item__actions {
    width: 96px
}

.block--reveal-widget .block-item__actions .button__icon--share.hidden,
.block--reveal-widget .block-item__actions .button__icon--feedback.hidden,
.block--reveal-widget .block-item__actions.hidden {
    opacity: 0;
    visibility: hidden;
    height: 0
