.reveal-widget__dialog-region {
    height: 1px;
    width: 1px;
    position: absolute;
    left: -10000px
}

.reveal-widget__speech-bubble {
    display: inline-block;
    position: absolute;
    right: 30px;
    bottom: 20px;
    animation: 1600ms infinite speechBubbleBounce;
    animation-timing-function: cubic-bezier(0.18, -0.06, 0.03, 1.07)
}

.reveal-widget__speech-bubble .speech-bubble__laughing-face {
    position: absolute;
    top: 35px;
    left: 27px
}

.reveal-widget__speech-bubble .speech-bubble__tap-reveal {
    position: absolute;
    top: 35px;
    left: 27px
}

.reveal-widget__projectiles span {
    position: absolute;
    bottom: 60px;
    right: 60px
}

.reveal-widget__projectiles svg {
    height: 48px;
    width: 48px;
    fill: white
}

.reveal-widget__projectiles span:nth-of-type(1) {
