@keyframes footer-appear {
    0% {
        bottom: -48px
    }

    100% {
        bottom: 0;
        visibility: visible
    }
}

@keyframes footer-disappear {
    0% {
        bottom: 0
    }

    100% {
        bottom: -48px
    }
}

@keyframes cookieSlideUp {
    from {
        bottom: 36px;
        transition-timing-function: cubic-bezier(0.64, 0.04, 0.35, 1);
        transform-origin: bottom
    }

    to {
        bottom: 77px;
        transition-timing-function: cubic-bezier(0.64, 0.04, 0.35, 1)
    }
}

@keyframes cookieBounce {

    from,
    to {
        bottom: 77px;
        transition-timing-function: cubic-bezier(0.64, 0.04, 0.35, 1)
    }

    20% {
        bottom: 45px;
        transition-timing-function: cubic-bezier(0.64, 0.04, 0.35, 1)
    }

    30% {
        bottom: 37px;
        transition-timing-function: cubic-bezier(0.64, 0.04, 0.35, 1)
    }

    13%,
    27%,
    37%,
    62% {
        bottom: 36px;
        transition-timing-function: cubic-bezier(0.64, 0.04, 0.35, 1)
    }
}

@keyframes cookieShadowBounce {

    from,
    to {
        width: 109px;
        height: 9px;
        transition-timing-function: cubic-bezier(0.64, 0.04, 0.35, 1)
    }

    20% {
        width: 109px;
        height: 9px;
        transition-timing-function: cubic-bezier(0.64, 0.04, 0.35, 1)
    }

    13%,
    27%,
    37%,
    62% {
        width: 146px;
        height: 12px;
        transition-timing-function: cubic-bezier(0.64, 0.04, 0.35, 1)
    }
}

@keyframes shadowAnim {
    50% {
        transform: scale(0.7, 0.7)
    }
}

@keyframes speechBubbleBounce {

    from,
    to {
        transform: translateY(0) rotate(0)
    }

    50% {
        transform: translateY(-20px) rotate(15deg)
    }
}

@keyframes projectile-1 {
    0% {
        transform: translate(0, 0) scale(1)
    }

    100% {
        transform: translate(-100px, -100px) scale(0) rotate(40deg);
        opacity: 0
    }
}

@keyframes projectile-2 {
    0% {
        transform: translate(0, 0) scale(1.2)
    }

    100% {
        transform: translate(0px, -150px) scale(0) rotate(20deg);
        opacity: 0
    }
}

@keyframes projectile-3 {
    0% {
        transform: translate(0, 0) scale(0.8)
    }

    100% {
        transform: translate(80px, -100px) scale(0) rotate(60deg);
        opacity: 0
    }
}

@keyframes projectile-4 {
    0% {
        transform: translate(0, 0) scale(1)
    }

    100% {
        transform: translate(30px, -120px) scale(0);
        opacity: 0
    }
}

@keyframes projectile-5 {
    0% {
        transform: translate(0, 0) scale(1.2)
    }

    100% {
        transform: translate(-80px, -150px) scale(0) rotate(40deg);
        opacity: 0
    }
}

@keyframes projectile-6 {
    0% {
        transform: translate(0, 0) scale(1.2)
    }

    100% {
        transform: translate(-30px, -120px) scale(0) rotate(-80deg);
        opacity: 0
    }
}

@keyframes projectile-7 {
    0% {
        transform: translate(0, 0) scale(1)
    }

    100% {
        transform: translate(20px, -100px) scale(0) rotate(50deg);
        opacity: 0
    }
}

@keyframes projectile-8 {
    0% {
        transform: translate(0, 0) scale(1)
    }

    100% {
        transform: translate(-150px, -80px) scale(0) rotate(-30deg);
        opacity: 0
    }
}

@keyframes pulseAnimation {
    0% {
        opacity: 0.2
    }

    50% {
        opacity: 0.4
    }

    100% {
        opacity: 0.2
    }
}

