@keyframes activeWrapperLeft {
    0% {
        left: 16px
    }

    30% {
        transform: scale(0.7, 0.7);
        left: 16px
    }

    60% {
        transform: scale(1, 1.05);
        left: 8px;
        top: 0;
        width: 56.6%
    }

    100% {
        left: 16px;
        width: 53.5%
    }
}

@keyframes activeWrapperRight {
    30% {
        transform: scale(0.7, 0.7);
        right: 0px
    }

    60% {
        transform: scale(1, 1.05);
        right: 8px;
        top: 0;
        width: 56.6%
    }

    100% {
        right: 16px;
        width: 53.5%
    }
}

@keyframes hide {
    0% {
        opacity: 1
    }

    100% {
        opacity: 0
    }
}

@keyframes activeNoRight {
    30% {
        transform: none;
        right: 16px
    }

    60% {
        transform: scale(0.6);
        right: 0
    }

    100% {
        transform: scale(0.75);
        opacity: 0.5;
        right: 0
    }
}

@keyframes activeNoLeft {
    30% {
        transform: none;
        left: 16px
    }

    60% {
        transform: scale(0.6);
        left: 0
    }

    100% {
        transform: scale(0.75);
        opacity: 0.5;
        left: 0
    }
}

@keyframes hideLabel {
    0% {
        transform: scaleX(1.5, 0.9);
        opacity: 1
    }

    30% {
        transform: scaleX(1.5, 0.9)
    }

    60% {
        opacity: 0
    }

    100% {
        opacity: 0
    }
}

@keyframes showLabel {
    30% {
        opacity: 0
    }

    60% {
        opacity: 1
    }

    100% {
        opacity: 1
    }
}

@media screen and (max-width: 320px) {
    .block--voting_block .wrapper:after {
        height: 265px
    }

    .block--voting_block header .title {
        margin-top: 0;
        justify-content: center;
        height: 100%
    }

    .block--voting_block header .title div:last-child {
        font-size: 11px !important
    }

    .block--voting_block .vote .box {
        font-size: 14px !important
    }

    .block--voting_block .vote.no .box {
        object-fit: contain
    }

    .block--voting_block .vote.yes .vote-wrapper .label {
        font-size: 18px !important
    }

    .block--voting_block .vs {
        width: 46px;
        height: 46px;
        margin-top: -34px;
        margin-left: -23px
    }

    .block--voting_block .vs .inner {
        width: 36px;
        height: 36px;
        font-size: 20px !important
    }

    .block--voting_block footer {
        font-size: 11px !important
    }

    :first-child.yes {
        animation: activeWrapperSmallLeft 1400ms ease-out !important;
        animation-fill-mode: forwards !important
    }

    :last-child.yes {
        animation: activeWrapperSmallRight 1400ms ease-out !important;
        animation-fill-mode: forwards !important
    }
}

@keyframes activeWrapperSmallLeft {
    0% {
        left: 16px
    }

    30% {
        left: 8px;
        transform: scale(0.75, 0.75)
    }

    60% {
        transform: scale(1, 1.05);
        width: 53.5%;
        left: 12px;
        top: 0
    }

    100% {
        width: 51.5%;
        left: 16px
    }
}

@keyframes activeWrapperSmallRight {
    30% {
        right: 4px;
        transform: scale(0.75, 0.75)
    }

    60% {
        transform: scale(1, 1.05);
        right: 12px;
        width: 53.5%;
        top: 0
    }

    100% {
        right: 16px;
        width: 51.5%
    }
}

.block--podcast-large {
    overflow-x: hidden
}

.block--podcast-large .block__main .block-item {
    position: relative;
    padding-bottom: 1rem;
    z-index: 1
}

:root[data-color-scheme='dark'] .block--podcast-large .block__main .block-item__body-header-light {
    display: none
}

:root[data-color-scheme='dark'] .block--podcast-large .block__main .block-item__playbutton-insert {
    background-color: #ffffff;
    color: #000000 !important
}

:root[data-color-scheme='light'] .block--podcast-large .block__main .block-item__body-header-dark {
    display: none
}

:root[data-color-scheme='light'] .block--podcast-large .block__main .block-item__playbutton-insert {
    background-color: #000000;
    color: #ffffff
}

:root[data-color-scheme='light'] .block--podcast-large .block__main .block-item__timestamp {
    color: #000000 !important
}

.block--podcast-large .block__main .block-item__musicbars {
    position: absolute;
    height: 100%;
    width: 100%;
    background-size: contain;
    background-position: 82px 25px;
    background-repeat: no-repeat;
    z-index: 0
}

