.slider-container {
    width: 100%;
    height: 288px;
    position: relative;
    margin: auto
}

.slider-slide {
    display: none
}

.prev,
.next {
    cursor: pointer;
    position: absolute;
    top: 40%;
    width: auto;
    margin-top: -22px;
    padding: 16px;
    color: white;
    font-weight: bold;
    font-size: 18px;
    transition: 0.6s ease;
    border-radius: 0 8px 8px 0;
    user-select: none;
    z-index: 999
}

.next {
    right: 0;
    border-radius: 8px 0 0 8px
}

.prev:hover,
.next:hover {
    background: rgba(255, 255, 255, 0.2)
}

.next:hover {
    border-radius: 8px 0px 0px 8px
}

.prev:hover {
    border-radius: 0px 8px 8px 0px
}

.slider-dots-container {
    padding: 0 8px;
    position: absolute;
    top: 210px;
    z-index: 6;
    display: flex;
    width: 100%
}

.slider-dots-container .dot {
    position: relative;
    transition: background-color 0.6s ease;
    background-color: rgba(255, 255, 255, 0.3);
    border-radius: 4px;
    height: 2px;
    margin: 0 4px;
    overflow: hidden
}

.slider-dots-container .dot::after {
    position: absolute;
    content: '';
    top: 0;
    left: 0;
    width: 0;
    height: 2px;
    background-color: #fff;
    width: var(--width)
}

.slider-dots-container .active::after {
    animation: fade 7145ms ease-out;
    animation-fill-mode: forwards;
    background-color: #fff
}

@-webkit-keyframes fade {
    0% {
        width: 0%
    }

    100% {
        width: 100%
    }
}

@keyframes fade {
    0% {
        width: 0%
    }

    100% {
        width: 100%
    }
}

:root[data-mp-theme='amxbar'] a {
    color: #000
}

:root[data-color-scheme='dark']:root[data-mp-theme='amxbar'] a {
    color: #fff
}

:root[data-mp-theme='amxbar'] a:active {
    color: #000
}

:root[data-color-scheme='dark']:root[data-mp-theme='amxbar'] a:active {
