@keyframes fadeIn {
    from {
        visibility: visible;
        opacity: 0
    }

    to {
        visibility: visible;
        opacity: 1
    }
}

@keyframes slideFromTop {
    from {
        transform: translateY(-300px)
    }
}

@keyframes fadeOut {
    from {
        visibility: visible;
        opacity: 1
    }

    to {
        visibility: hidden;
        opacity: 0
    }
}

@keyframes rotateIn {
    from {
        visibility: visible;
        transform-origin: center;
        transform: rotate3d(0, 0, 1, -45deg);
        opacity: 0
    }

    to {
        visibility: visible;
        transform-origin: center;
        transform: translate3d(0, 0, 0);
        opacity: 1
    }
}

@keyframes rotateOut {
    from {
        visibility: visible;
        transform-origin: center;
        opacity: 1
    }

    to {
        visibility: hidden;
        transform-origin: center;
        transform: rotate3d(0, 0, 1, -45deg);
        opacity: 0
    }
}

.mp-modal {
    display: none
}

.mp-modal.active {
    display: block
}

.mp-modal__overlay {
    z-index: 9999;
    position: fixed;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    background: rgba(0, 0, 0, 0.7);
    display: flex;
    justify-content: center;
    align-items: center;
    transition: opacity 0.3s cubic-bezier(0, 0, 0.2, 1)
}

.mp-modal__container {
    position: relative;
    background-color: white;
    max-width: 100%;
    max-height: 100%;
    overflow-y: scroll;
    overflow-x: hidden;
    padding: 25px;
    border-radius: 4px
}

:root[data-color-scheme='dark'] .mp-modal__container {
    background-color: #353535;
    color: #fff
}

.mp-modal__header {
    display: flex;
    justify-content: space-between
}

.mp-modal__title {
    text-transform: uppercase
}

.mp-modal__button {
    background: none
}

.mp-modal__button:not(.mp-modal__button--close) {
    padding: 0.8rem 1rem;
    border-radius: 0.25rem
}

:root[data-color-scheme='dark'] .mp-modal__button--cancel {
    color: #fff
}

.mp-modal__button--submit {
    background: #212121;
    color: white
}

.mp-modal__button--close {
    position: absolute;
    top: 12px;
    right: 12px;
    height: 48px;
    width: 48px
}

:root[data-color-scheme='dark'] .mp-modal__button--close {
    color: #fff
}

.mp-modal__content {
    padding: 20px 0
}

.mp-modal__content p {
    line-height: 1.5em
}

.mp-modal__footer {
    display: flex;
    justify-content: space-around
}

.mp-modal[aria-hidden='true'] .mp-modal__overlay {
    opacity: 0
}

.mp-modal[aria-hidden='true'] .mp-modal__container {
    animation: slideOut 0.3s cubic-bezier(0, 0, 0.2, 1)
}

.mp-modal[aria-hidden='false'] .mp-modal__overlay {
    opacity: 1
}

.mp-modal[aria-hidden='false'] .mp-modal__container {
    animation: slideIn 0.3s cubic-bezier(0, 0, 0.2, 1)
}

@keyframes slideIn {
    from {
        transform: translateY(15%)
    }

    to {
        transform: translateY(0)
    }
}

@keyframes slideOut {
    from {
        transform: translateY(0)
    }

    to {
        transform: translateY(-10%)
    }
}

