@keyframes personalizationSlideIn {
    from {
        transform: translateY(100%)
    }

    to {
        transform: translateY(0)
    }
}

@keyframes personalizationSlideOut {
    from {
        transform: translateY(0)
    }

    to {
        transform: translateY(100%)
    }
}

@keyframes personalizationOpacityIn {
    from {
        opacity: 0
    }

    to {
        opacity: 1
    }
}

@keyframes personalizationOpacityOut {
    from {
        opacity: 1
    }

    to {
        opacity: 0
    }
}

@keyframes fadeIn {
    from {
        visibility: visible;
        opacity: 0
    }

    to {
        visibility: visible;
        opacity: 1
    }
}

@keyframes slideFromTop {
    from {
        transform: translateY(-300px)
    }
}

@keyframes fadeOut {
    from {
        visibility: visible;
        opacity: 1
    }

    to {
        visibility: hidden;
        opacity: 0
    }
}

@keyframes rotateIn {
    from {
        visibility: visible;
        transform-origin: center;
        transform: rotate3d(0, 0, 1, -45deg);
        opacity: 0
    }

    to {
        visibility: visible;
        transform-origin: center;
        transform: translate3d(0, 0, 0);
        opacity: 1
    }
}

@keyframes rotateOut {
    from {
        visibility: visible;
        transform-origin: center;
        opacity: 1
    }

    to {
        visibility: hidden;
        transform-origin: center;
        transform: rotate3d(0, 0, 1, -45deg);
        opacity: 0
    }
}

